import React, { Component } from 'react';
import Table from './Components/table';
import Button from './Components/Button';
import Ul from './Components/ul';
import Cities from './cities.json'
class App extends Component{
constructor(){
  super()
  this.state={
    contenarray : Cities,
    Citieslength: Cities.length ,
    startshow : 3 ,
    notesonpaeg : 5
  }

}

render() {
const {contenarray ,Citieslength ,startshow ,notesonpaeg } = this.state
let start =  (startshow - 1) * notesonpaeg ; // عنما نضغط على الرقم يعمل العمليه الاتي1* 5=  0هدي العمليه الاوله  
let end = start + notesonpaeg;
let notes = contenarray.slice( start , end  );

const paginate = pageNum => this.setState({startshow: pageNum})


  return(
    <div>
    <Button/>
    <Table datajson={notes}/>
    <Ul Citieslength={Citieslength}   notesonpaeg ={notesonpaeg} paginate={paginate} />
    </div>
  )
}
}
export default App;
